RU:
В наборе 2 обычных значка и 1 редкий или эпический значок для бойца <BRAWLER>. Шансы получения:

редкий значок — <Rare> %;
эпический значок — <Epic> %.

В этом наборе <NUM> шт. обычных значков и один особый значок. Особый значок может оказаться редким или эпическим. Шансы получения:

редкий значок — <Rare> %;
эпический значок — <Epic> %.

В этом наборе <NUM> шт. обычных значков и один особый значок. Особый значок может оказаться редким, эпическим или легендарным. Шансы получения:

редкий значок — <Rare> %;
эпический значок — <Epic> %;
легендарный значок — <LEGENDARY> %.
